INSERT INTO `package` (`id`, `country`, `duration`, `title`, `price`, `date`, `description`, `Image`) VALUES
(1, 'KOREA', '7D6N', 'Seoul City + Jeju Island + Lotte World', '3500', '9/6/2019-14/6/2019', 'Day 1: Arrival \r\nUpon arrival at Incheon International Airport, Local tour guide will meet guests on 09:30 am at “GATE A”. \r\n\r\nAfter that, Tour will start with transferring to “Songwol-dong Fairy Tale Village” and move to “Incheon China Town”.\r\nAnd visit “Buckchon Hanok village” after lunch, Check in Hotel. Hotels: \r\n-Incheon Air relax hotel \r\n-or Diamond hotel \r\n-or Secret Hotel \r\n-or similar class\r\nDay 2: Seoul: B/L\r\nAfter Breakfast, Visit Deoksugung Palace, Ginseng Shop & Herbal Shop, Kimchi Making Session & Wear the Korea Traditional Costume, Cosmetic shop, Myeongdong strret & Lotte Duty free.\r\n\r\nDay 3: Seoul & Jeju Island \r\nAfter Breakfast, visit Namsangol Hanok Village and move to Pine tree gallery. After that, move to Shinchon lady’s street. Transfer to Jeju using domestic filight at Gimpo airport. Upon arrival at Jeju airport, transfer to Yongduam Rock and check in Hotel.\r\nDay 4: Jeju Island \r\nAfter Breakfast, Visit Mysterious road and Seongsan Ilchulbong. After that, transfer to Seongeup village and Oedolgae, Orange farm. Move to Teseum safari and Cheongiyeon Falls.\r\nDay 5: Lottle World \r\nThereafter enjoy a shopping spree in Myeongdong. Located in the heart of Seoul, you are able to find all kinds of shops and restaurants in here. Lastly proceed to Korea’s largest indoor theme park – Lotte World Theme Park (Admission Only), where the “Stairways to Heaven” was filmed. It comprises the Lotte World Adventure – an indoor theme park and Magic Island – an outdoor lakeside amusement park.\r\nDay 6: Jeju Island \r\nCheck out from hotel. After breakfast, go to Incheon international airport. Home Sweet Home. Transfer airport. ~ End Tour ~', );
INSERT INTO `package` (`id`, `country`, `duration`, `title`, `price`, `date`, `description`, `Image`) VALUES
(2, 'JAPAN', '7D6N', 'Tokyo Disneyland + Osaka Universal Studio', '4500', '22/7/2019-28/7/2019', 'Day 1:Arrival Tokyo \r\nUpon arrival at Haneda Airport, transfer to hotel by seat-in-coach.\r\nDay 2: SIC Half-Day Tokyo City tour (Breakfast)/L\r\n\r\n-Tokyo Tower: Enjoy a panorama of Tokyo from the main observation platform. (Approx.30minute) \r\n-Meiji Shrine: Take in a fine example of Japanese shrine architecture, nestled in a peaceful, picturesque area. (Approx. 40minute) \r\n-Drive pass Akasaka Guest House and National Diet building. \r\n-Imperial Palace East garden: Enjoy a pleasant walk through the east garden of the Imperial Palace, a place of historical interest and scenic beauty. (Mon, Fri & when East garden is closed, the itinerary will replace with Imperial Palace Plaza and Double bridge. (Approx. 40minute) \r\nTour dismiss at Ginza shopping district (On own arrangement back to hotel)\r\nDay 3:Disneyland or Disney Sea (Breakfast) \r\nEnjoy your day trip to Disneyland or DisneySea by taking a train from your nearest station to JR Maihama station. (Theme park ticket and return transfer by train service ticket included)\r\n\r\nDay 4: Tokyo Station – Shin Osaka (* Bullet Train) (Breakfast) \r\nAfter breakfast at hotel, transfer to Tokyo Station and take bullet train from Tokyo to Osaka Shin Osaka station. Once you arrive Osaka station, our local representative will transfer you to the hotel.\r\n\r\nDay 5: Full Day Kyoto & Nara tour with lunch (Lunch) \r\nNijo Castle \r\nThe Kyoto residence of the Tokugawa Shogun, the main keep of which was built in 1603, is noted for the contrast of its solemn exterior and gorgeous interiors. \r\nKinkakuji Temple\r\nThis temple is renowned its beautiful Japanese garden and stunning Golden Paillion. \r\nKyoto Imperial Palace \r\nThis exclusive compound can only be accessed as part of an organized tour group. (closed on Sat, Sun & National Holidays, replaced by Nishi Honganji Temple – this large, world heritage – registered temple was establish in 1602) \r\nTodaiji Temple \r\nSee the towering Great Buddha housed in the world’s largest wooden building. \r\nNara Deer Park\r\nMore than 1,000 tame deer roam freely in this verdant, 1,250 acre park. \r\nKasuga Grand Shrine \r\nThe most famous and beautiful Shinto Shrine in Nara, it features some 3,000 antique stone and bronze lanterns. \r\nNara Nagomikan\r\nOffers a wide variety of local crafts, goods and souvenirs.\r\n\r\nDay 6: Universal Studio Full Day Tour (Breakfast) \r\nAfter breakfast, depart at 0850 - 0900am or 1050 – 1100am from hotel to Universal Studio Theme park. Enjoy full day of excitement at Universal Studio Japan with free rides and do not miss the show and parades also. Return at 1700pm or 2100pm. \r\nDay 7: Osaka Departure (Breakfast) \r\nAfter breakfast at hotel, free at leisure until time for seat-in-coach transfer to airport. ', );
INSERT INTO `package` (`id`, `country`, `duration`, `title`, `price`, `date`, `description`, `Image`) VALUES
(3, 'HONG KONG', '4D3N', 'Hong Kong Disneyland Package', '2000', '13/8/2019-16/8/2019', 'Day 1: Kuala Lumpur to Hong Kong \r\nUMeet on arrival, transfer to Disney Hollywood Hotel for check-in. Overnight: Disney Hollywood Hotel – Garden View\r\nDay 2:Disneyland Hong Kong\r\nCheck-out at 11:00 then whole day enjoy at Disneyland until fireworks transfer back to hotel in down town. If request early transfer before fireworks then guest own arrangement.\r\n\r\nDay 3:Hong Kong City Tour \r\nRepulse Bay,Aberdeen Fishing Village & shopping shops. Then proceed to Avenue of Stars.Dismiss at Tsim Sha Tsui, guest own arrangement back to selected hotel.\r\n\r\nDay 4: Hong Kong to Kuala Lumpur \r\nFree till transfer to airport for your flight back home.', );
