(4, 'MALAYSIA', '3D2N', 'Hotel + Legoland® Malaysia Theme Park + Sanrio Hello Kitty & Thomas Town\r\nAdmission', '1200', '26/11/2019-27/11/2019', 'Day 1 \r\n-Arrived JB Hotel, Check In Hotel.\r\n\r\n-9am until 9.30am pick up to Legoland. (Optional).\r\n\r\n-Evening 6pm return transfer to the hotel.w\r\nDay 2\r\n-9am until 9.30am pick up to Puteri Harbour.\r\n\r\n-Evening 6pm return transfer to the hotel.\r\n\r\nDay 3\r\n-Breakfast.\r\n\r\n-Check Out Hotel.', );

